import React, {Component} from 'react';
import {Col} from "react-bootstrap";
import {Image} from "react-bootstrap";

class Logo extends Component {
    render() {
        return (
            <Col>
                <Image src="https://cdnjs.cloudflare.com/ajax/libs/browser-logos/58.1.3/webkit/webkit_64x64.png" />
                Electronic Shop
            </Col>
        );
    }
}

export default Logo;
